         "This privacy statement describes how IBM collects, uses and shares your information. It applies to IBM Corporation and IBM subsidiaries except where a subsidiary presents its own statement without reference to IBM\u2019s." : "This privacy statement describes how IBM collects, uses and shares your information. It applies to IBM Corporation and IBM subsidiaries except where a subsidiary presents its own statement without reference to IBM’s.",
         "App Specific Statement" : "App Specific Statement",
         "The App allows the user to take images of machines or other assets as part of using the Maximo Application Suite of software. While this App is designed for images solely of assets, background may be inadvertently included. Accordingly, you must ensure you have all necessary permissions to take and use the images, including but not restricted to, permission to take images in the area in which you are working. You are solely responsible for the images, voice recordings, annotations and the like which are taken by the App and used by the Authorized Programs." : "The App allows the user to take images of machines or other assets as part of using the Maximo Application Suite of software. While this App is designed for images solely of assets, background may be inadvertently included. Accordingly, you must ensure you have all necessary permissions to take and use the images, including but not restricted to, permission to take images in the area in which you are working. You are solely responsible for the images, voice recordings, annotations and the like which are taken by the App and used by the Authorized Programs.",
         "In addition, as part of the operation of the App, certain data may be transmitted and stored, including, but not limited to, user ID, phone numbers, email addresses, digital signatures, geolocations, camera (for images and video), audio and similar personal information. You may also choose to include other data of a personal or sensitive nature. To the extent you control any such data, you are responsible for obtaining all necessary permissions and adhering to all applicable data privacy regulations" : "In addition, as part of the operation of the App, certain data may be transmitted and stored, including, but not limited to, user ID, phone numbers, email addresses, digital signatures, geolocations, camera (for images and video), audio and similar personal information. You may also choose to include other data of a personal or sensitive nature. To the extent you control any such data, you are responsible for obtaining all necessary permissions and adhering to all applicable data privacy regulations",
         "IBM may push certain notifications to your copy of the App. You agree to receive such notifications. We may provide additional data privacy information by using a supplementary privacy notice." : "IBM may push certain notifications to your copy of the App. You agree to receive such notifications. We may provide additional data privacy information by using a supplementary privacy notice.",
