         "Your Account \u2013 If your mobile app requires an IBMid" : "Your Account – If your mobile app requires an IBMid",
         "You can create an account with IBM by creating an IBMid. An IBMid provides IBM with your name, email address, and country or region of residence. We may require an IBMid for certain services, such as the use of IBM Cloud and Online Services (see below)." : "You can create an account with IBM by creating an IBMid. An IBMid provides IBM with your name, email address, and country or region of residence. We may require an IBMid for certain services, such as the use of IBM Cloud and Online Services (see below).",
         "We may also store your details from business contact information that you provide to us, or that we collect from your organization, our Business Partners, or our suppliers." : "We may also store your details from business contact information that you provide to us, or that we collect from your organization, our Business Partners, or our suppliers.",
         "An IBMid uniquely identifies you when you access our websites, make a request or order, or use a product or service. If you log in to our websites with an IBMid we may link the information we collect with your account. An IBMid is also used to give you access to IBM Cloud and Online Services (see below) and allows you to manage your contract and billing history. The email address in your IBMid may be used to contact you in relation to any services to which you subscribe." : "An IBMid uniquely identifies you when you access our websites, make a request or order, or use a product or service. If you log in to our websites with an IBMid we may link the information we collect with your account. An IBMid is also used to give you access to IBM Cloud and Online Services (see below) and allows you to manage your contract and billing history. The email address in your IBMid may be used to contact you in relation to any services to which you subscribe.",
