         "Marketing" : "Marketing",
         "We use the information that we collect to communicate with you about relevant products, services, and offerings. We also use this information to personalize your experience with our content and advertisements, and to develop internal marketing and business intelligence. To set or update your marketing communications preferences, visit the IBM Privacy Preference Center at https:\/\/myibm.ibm.com\/profile\/dataprivacypreferences\/welcome\/us-en. You may also submit an opt-out request, (https:\/\/www.ibm.com\/account\/reg\/us-en\/signup?formid=urx- 42537) or select Unsubscribe at the bottom of each marketing email. To review or set your preferences regarding the information that we collect about you on our websites select Cookie Preferences in the website footer." : "We use the information that we collect to communicate with you about relevant products, services, and offerings. We also use this information to personalize your experience with our content and advertisements, and to develop internal marketing and business intelligence. To set or update your marketing communications preferences, visit the IBM Privacy Preference Center at https://myibm.ibm.com/profile/dataprivacypreferences/welcome/us-en. You may also submit an opt-out request, (https://www.ibm.com/account/reg/us-en/signup?formid=urx- 42537) or select Unsubscribe at the bottom of each marketing email. To review or set your preferences regarding the information that we collect about you on our websites select Cookie Preferences in the website footer.",
         "We use contact information that we collect directly from you, your organization, or third-party data providers, to communicate with you about our products, services, and offerings. When we obtain information about you indirectly from third parties, we implement checks and controls to confirm that this information was legally acquired by the third party and that the third party has the right to provide the information to us for our use in marketing." : "We use contact information that we collect directly from you, your organization, or third-party data providers, to communicate with you about our products, services, and offerings. When we obtain information about you indirectly from third parties, we implement checks and controls to confirm that this information was legally acquired by the third party and that the third party has the right to provide the information to us for our use in marketing.",
         "We may, subject to your preferences, collect information about your interactions with our websites (see above), our emails (such as whether emails are opened or links selected), and other IBM content, including content on third-party sites. For more information on the technologies that we use to collect this information, and setting your preferences, see Cookies and Similar Technologies (below)." : "We may, subject to your preferences, collect information about your interactions with our websites (see above), our emails (such as whether emails are opened or links selected), and other IBM content, including content on third-party sites. For more information on the technologies that we use to collect this information, and setting your preferences, see Cookies and Similar Technologies (below).",
         "We use this information to develop internal marketing and business intelligence. For example, we may:" : "We use this information to develop internal marketing and business intelligence. For example, we may:",
         "    Combine the information collected to better understand your interests and potential business needs, such as IBM events you attend, content you review, or any of our websites that you visit." : "    Combine the information collected to better understand your interests and potential business needs, such as IBM events you attend, content you review, or any of our websites that you visit.",
