         "Camera supervision and access management are used for reasons of security and safety of our locations, employees, and assets. More information may be available at the IBM location." : "Camera supervision and access management are used for reasons of security and safety of our locations, employees, and assets. More information may be available at the IBM location.",
         "Recruitment and Former Employees" : "Recruitment and Former Employees",
         "We are constantly searching for new talent for our organization, and we collect information about job applicants or prospective candidates from several sources. Applicants are referred to the Talent Acquisition Privacy Notice at https:\/\/www.ibm.com\/employment\/talent_acquisition_privacy.htmlfor more information. When an employee leaves IBM, we continue to process information that is related to them for any remaining business, contractual, employment, legal, and fiscal purposes, including the management of pensions to the extent handled by IBM." : "We are constantly searching for new talent for our organization, and we collect information about job applicants or prospective candidates from several sources. Applicants are referred to the Talent Acquisition Privacy Notice at https://www.ibm.com/employment/talent_acquisition_privacy.htmlfor more information. When an employee leaves IBM, we continue to process information that is related to them for any remaining business, contractual, employment, legal, and fiscal purposes, including the management of pensions to the extent handled by IBM.",
         "Regarding recruitment, we may look for prospective candidates with the help of recruitment intermediaries and may use publicly available information on social media platforms to identify prospective candidates for a specific function." : "Regarding recruitment, we may look for prospective candidates with the help of recruitment intermediaries and may use publicly available information on social media platforms to identify prospective candidates for a specific function.",
         "When an employee leaves IBM, we retain basic information from the former employee about their employment at IBM." : "When an employee leaves IBM, we retain basic information from the former employee about their employment at IBM.",
         "After an employee retires, we process information about the retiree for fulfilling the pension obligations toward the retiree. Information about the processing of pension information, or other retirement programs, can be found with the local organization responsible for pensions. In some countries, this may be an independent organization. In some cases, retirees may still participate in IBM-organized initiatives or programs, such as volunteer and social responsibility programs. Such participation is voluntary, and more information is provided on the relevant websites or information pages for those initiatives." : "After an employee retires, we process information about the retiree for fulfilling the pension obligations toward the retiree. Information about the processing of pension information, or other retirement programs, can be found with the local organization responsible for pensions. In some countries, this may be an independent organization. In some cases, retirees may still participate in IBM-organized initiatives or programs, such as volunteer and social responsibility programs. Such participation is voluntary, and more information is provided on the relevant websites or information pages for those initiatives.",
         "Conducting our Business Operations" : "Conducting our Business Operations",
         "We collect and use information to improve our business operations, systems, and processes. For example, information may be used to conduct, maintain, audit, and optimize our operations, to protect our assets and employees, for product development, and to defend our rights." : "We collect and use information to improve our business operations, systems, and processes. For example, information may be used to conduct, maintain, audit, and optimize our operations, to protect our assets and employees, for product development, and to defend our rights.",
         "We collect information about our business operations to make informed decisions about the organization, the business, and to report on performance, audits, and trends. For example, we use this information to analyze the costs and quality of our operations. Where possible, this is done by using aggregated information, but it may use personal information." : "We collect information about our business operations to make informed decisions about the organization, the business, and to report on performance, audits, and trends. For example, we use this information to analyze the costs and quality of our operations. Where possible, this is done by using aggregated information, but it may use personal information.",
         "We collect and use information from our business systems, which may include personal information, to:" : "We collect and use information from our business systems, which may include personal information, to:",
         "    Protect or enforce our rights, including to detect fraud or other criminal activities (for example, by using information in payment systems)" : "    Protect or enforce our rights, including to detect fraud or other criminal activities (for example, by using information in payment systems)",
