         "Sharing Personal Information" : "Sharing Personal Information",
         "We may share your personal information internally and externally with suppliers, advisors, or Business Partners for IBM\u2019s legitimate business purposes, and only on a need-to-know basis. This section describes how we share information and how we facilitate that sharing." : "We may share your personal information internally and externally with suppliers, advisors, or Business Partners for IBM’s legitimate business purposes, and only on a need-to-know basis. This section describes how we share information and how we facilitate that sharing.",
         "How We Share Personal Information" : "How We Share Personal Information",
         "When sharing personal information, we implement appropriate checks and controls to confirm that the information can be shared." : "When sharing personal information, we implement appropriate checks and controls to confirm that the information can be shared.",
         "If we decide to sell, buy, merge, or otherwise reorganize businesses in some countries, such a transaction may involve disclosing some personal information to prospective or actual business purchasers, or the collection of personal information from those selling such businesses." : "If we decide to sell, buy, merge, or otherwise reorganize businesses in some countries, such a transaction may involve disclosing some personal information to prospective or actual business purchasers, or the collection of personal information from those selling such businesses.",
         "Internally, personal information is shared for our legitimate business purposes, such as managing our relationship with you and other external parties, compliance programs, or systems and networks security. We do this to improve efficiency, for cost savings, and internal collaboration between our subsidiaries. Our internal access to personal information is restricted and granted only on a need-to-know basis. Sharing of this information is subject to the appropriate intracompany arrangements, our policies, and security standards." : "Internally, personal information is shared for our legitimate business purposes, such as managing our relationship with you and other external parties, compliance programs, or systems and networks security. We do this to improve efficiency, for cost savings, and internal collaboration between our subsidiaries. Our internal access to personal information is restricted and granted only on a need-to-know basis. Sharing of this information is subject to the appropriate intracompany arrangements, our policies, and security standards.",
         "Externally," : "Externally,",
         "    Our business with suppliers may include the collection, use, analysis, or other types of processing of personal information on our behalf." : "    Our business with suppliers may include the collection, use, analysis, or other types of processing of personal information on our behalf.",
         "    Our business model includes cooperation with independent Business Partners for marketing, selling, and the provision of IBM products and services. Where appropriate, we share business contact information with selected Business Partners." : "    Our business model includes cooperation with independent Business Partners for marketing, selling, and the provision of IBM products and services. Where appropriate, we share business contact information with selected Business Partners.",
         "    We may share personal information with professional advisors, including lawyers, auditors, and insurance companies to receive their services." : "    We may share personal information with professional advisors, including lawyers, auditors, and insurance companies to receive their services.",
         "    We may share contractual relationship information with others, for instance, our Business Partners, financial institutions, shipping companies, postal, or government authorities, such as the customs authorities that are involved in fulfillment." : "    We may share contractual relationship information with others, for instance, our Business Partners, financial institutions, shipping companies, postal, or government authorities, such as the customs authorities that are involved in fulfillment.",
         "In certain circumstances, personal information may be subject to disclosure to government agencies in accordance with judicial proceedings, court orders, or legal processes. We may also share personal information to protect the rights of IBM or others when IBM believes that such rights may be affected, for example to prevent fraud." : "In certain circumstances, personal information may be subject to disclosure to government agencies in accordance with judicial proceedings, court orders, or legal processes. We may also share personal information to protect the rights of IBM or others when IBM believes that such rights may be affected, for example to prevent fraud.",
         "Facilitating International Transfers" : "Facilitating International Transfers",
         "Your information may be transferred to or accessed by IBM subsidiaries and third parties around the world. IBM complies with laws on the transfer of personal information between countries to keep your personal information protected, wherever it may be." : "Your information may be transferred to or accessed by IBM subsidiaries and third parties around the world. IBM complies with laws on the transfer of personal information between countries to keep your personal information protected, wherever it may be.",
