         "    IBM\u2019s privacy practices, described in this Privacy Statement, comply with the APEC Cross Border Privacy Rules Framework. The APEC Cross Border Privacy Rules (CBPR) system (http:\/\/cbprs.org\/) provides protection of personal information that is transferred among participating APEC economies (http:\/\/cbprs.org\/about-cbprs\/ ) as it pertains to online information collected through ibm.com." : "    IBM’s privacy practices, described in this Privacy Statement, comply with the APEC Cross Border Privacy Rules Framework. The APEC Cross Border Privacy Rules (CBPR) system (http://cbprs.org/) provides protection of personal information that is transferred among participating APEC economies (http://cbprs.org/about-cbprs/ ) as it pertains to online information collected through ibm.com.",
         "While the EU-US and Swiss-US Privacy Shield Framework can no longer be relied upon for the transfer of Personal Information, we continue to comply with all EU-US Privacy Shield Framework and Swiss-US Privacy Shield Framework obligations. For more information, see IBM Privacy Shield Privacy Policy (https:\/\/www.ibm.com\/privacy\/privacy-shield) and US Department of Commerce. (https:\/\/www.privacyshield.gov\/welcome)" : "While the EU-US and Swiss-US Privacy Shield Framework can no longer be relied upon for the transfer of Personal Information, we continue to comply with all EU-US Privacy Shield Framework and Swiss-US Privacy Shield Framework obligations. For more information, see IBM Privacy Shield Privacy Policy (https://www.ibm.com/privacy/privacy-shield) and US Department of Commerce. (https://www.privacyshield.gov/welcome)",
         "Controller and Representative Information \u2013 If your mobile app connects to an IBM Cloud or Online Service" : "Controller and Representative Information – If your mobile app connects to an IBM Cloud or Online Service",
         "IBM does business through its subsidiaries worldwide. The privacy laws in some countries consider a controller to be the legal entity (or natural person) who defines the purposes for which the processing of personal information takes place and how that information is processed. Parties that are involved in processing operations on behalf of a controller may be designated as processors. Designations and associated obligations differ, depending on the jurisdiction." : "IBM does business through its subsidiaries worldwide. The privacy laws in some countries consider a controller to be the legal entity (or natural person) who defines the purposes for which the processing of personal information takes place and how that information is processed. Parties that are involved in processing operations on behalf of a controller may be designated as processors. Designations and associated obligations differ, depending on the jurisdiction.",
