         "    submit a complaint to IBM if you are not satisfied with how IBM is processing your personal information." : "    submit a complaint to IBM if you are not satisfied with how IBM is processing your personal information.",
         "Information about additional rights and when they apply can be found https:\/\/www.ibm.com\/privacy\/additional-data-subjects-rights. Your rights may be subject to limitations and exceptions resulting from applicable laws. For example, there may be situations where we cannot share certain information that you seek if disclosing this means disclosing information about others." : "Information about additional rights and when they apply can be found https://www.ibm.com/privacy/additional-data-subjects-rights. Your rights may be subject to limitations and exceptions resulting from applicable laws. For example, there may be situations where we cannot share certain information that you seek if disclosing this means disclosing information about others.",
