         "To set or update your marketing communications preferences, visit the IBM Privacy Preference Center. (https:\/\/myibm.ibm.com\/profile\/dataprivacypreferences\/welcome\/us-en). You can also submit an opt-out request, (https:\/\/www.ibm.com\/account\/reg\/us-en\/signup?formid=urx- 42537 or select Unsubscribe at the end of each marketing email." : "To set or update your marketing communications preferences, visit the IBM Privacy Preference Center. (https://myibm.ibm.com/profile/dataprivacypreferences/welcome/us-en). You can also submit an opt-out request, (https://www.ibm.com/account/reg/us-en/signup?formid=urx- 42537 or select Unsubscribe at the end of each marketing email.",
         "Legal Basis" : "Legal Basis",
         "In some jurisdictions, the lawful handling of personal information is subject to a justification, sometimes referred to as legal basis. The legal bases that we rely on for the lawful handling of your personal information vary depending on the purpose and applicable law." : "In some jurisdictions, the lawful handling of personal information is subject to a justification, sometimes referred to as legal basis. The legal bases that we rely on for the lawful handling of your personal information vary depending on the purpose and applicable law.",
